import base64
from io import BytesIO
import pygame
from PIL import Image

str = b''
byte_data = base64.b64decode(str)
image_data = BytesIO(byte_data)
iconImage = Image.open(image_data)

# Konvertieren des Bildes in ein untersttztes Format
if iconImage.mode != 'RGB':
    pil_image = iconImage.convert('RGB')
iconImage.save('temp.bmp')

# Laden des Bildes in ein Surface-Objekt
iconImage = pygame.image.load('temp.bmp').convert_alpha()

